import React from 'react'
import MyAudiocards from './MyAudiocards.js'
import { Grid } from 'semantic-ui-react'


const Home = () => {
    return (
        <div className="HomeContainer">
            <Grid>
                <Grid.Row columns={3}>
                    <MyAudiocards />
                </Grid.Row>
            </Grid>
        </div>
    )
}

export default Home;
